import 'bootstrap/dist/css/bootstrap.min.css';
import Pages from "./components/Pages";

const App = () => {
  return (
    <>
      <div className="justify-content-end">
        <p style={{marginTop: 10, alignContent: right,}}>Username</p>
      </div>
      <Navbar />
      <Pages />
    </>
  );
}

export default App;
